/*Table structure for table `p2_customer` */

DROP TABLE IF EXISTS `p2_customer`;

CREATE TABLE `p2_customer` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `Customername` varchar(30) DEFAULT '',
  `Password` varchar(100) DEFAULT '',
  `addtime` int(11) DEFAULT '0',
  `status` smallint(6) DEFAULT '1',
  `planner_id` char(8) CHARACTER SET utf8mb4 NOT NULL DEFAULT '0' COMMENT ' 理财师ID',
  `register_openid` varchar(20) CHARACTER SET utf8mb4 DEFAULT NULL,
