  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(20) NOT NULL,
  `description` varchar(50) NOT NULL,
  `command` varchar(30) NOT NULL,
  `preMenu` int(11) NOT NULL DEFAULT '0',
