insert  into `p2_pfa_question`(`id`,`type_name`,`type`,`question_no`,`question`,`A1`,`A2`,`A3`,`A4`,`A5`,`A6`,`A`,`B`,`C`,`D`,`E`) values (0,'基本状况',0,1,'您是否同时符合以下条件：<br>\n1. 金融资产不低于500万元，或者最近3年个人年均收入不低于50万元；<br>\n2. 具有2年以上证券、基金、期货、黄金、外汇等投资经历，或者具有2年以上金融产品设计、投资、风险管理及相关工作经历，或者属于特定金融机构的高级管理人员、获得职业资格认证的从事金融相关业务的注册会计师和律师。<br>\n注：<br>\n1. 本部分题目中的金融资产，是指银行存款、股票债券、基金份额、资产管理计划、银行理财产品、信托计划、保险产品、期货及其他衍生产品等。<br>\n2. 本部分题目中的金融机构，包括证券公司、期货公司、基金管理公司及其子公司、商业银行、保险公司、信托公司、财务公司等；经行业协会备案或者登记的证券公司子公司、期货公司子公司、私募基金管理人。<br>','是','否','','','','',0,0,0,0,0),(1,'一、财务状况',1,1,'您的主要收入来源是','无固定收入','工资、劳务报酬','出租、出售房地产等非金融性资产收入','生产经营所得','利息、股息、转让等金融性资产收入','',0,3,1,2,1),(2,'一、财务状况',1,2,'您的家庭可支配年收入为（折合人民币）？','50万元以下','50—100万元','100—500万元','500—1000万元','1000万元以上','',1,2,4,6,8),(3,'一、财务状况',1,3,'在您每年的家庭可支配收入中，可用于金融投资（储蓄存款除外）的比例为？','小于10%','10%至30%','30%至50%','50%至70%','大于50%','',6,5,4,3,1),(4,'一、财务状况',1,4,'您是否有尚未清偿的数额较大的债务，如有，其性质是','有，住房抵押贷款等长期定额债务','有，亲戚朋友借款','有，信用卡欠款、消费信贷等短期信用债务','没有','','',2,0,1,3,0),(5,'二、投资知识',2,1,'您的投资知识可描述为：','有限：基本没有金融产品方面的知识','一般：对金融产品及其相关风险具有基本的知识和理解','丰富：对金融产品及其相关风险具有丰富的知识和理解','非常丰富，具有专业的证券期货等金融产品及相关风险知识，且理解深入。','','',1,2,3,5,0),(6,'二、投资知识',2,2,'您对于金融法律法规知识的了解程度可描述为：','有限：基本没有金融法律法规方面的知识','一般：对金融法律法规具有基本的知识和理解','丰富：对金融法律法规具有丰富的知识和理解','','','',1,3,5,0,0),(7,'二、投资知识',2,3,'您每年参加金融专业知识（基金、股票、债券、金融衍生品等）培训情况','从未参加','参加过1~5次','参加过5~20次','20次以上','','',1,2,3,4,0),(8,'三、投资经验',3,1,'如果您曾经从事过金融市场投资，在交易较为活跃的月份，平均月交易额大概是多少：','10万元以内','10万元-30万元','30万元-100万元','100万元以上','从未从事过金融市场投资','',1,2,3,4,0),(9,'三、投资经验',3,2,'您的投资经验可以被概括为','有限：除银行活期账户和定期存款外，我基本没有其他投资经验','一般：除银行活期账户和定期存款外，我购买过基金、保险等理财产品，但还需要进一步的指导','丰富：我是一位有经验的投资者，参与过股票、基金等产品的交易，并倾向于自己做出投资决策','非常丰富：我是一位非常有经验的投资者，参与过权证、期货或创业板等高风险产品的交易','','',0,1,2,4,0),(10,'三、投资经验',3,3,'过去一年内，您购买的不同产品或接受不同服务（含同一类型的不同产品或服务）的数量是','5个以下','6至10个','11至15个','16个以上','','',1,3,4,6,0),(11,'三、投资经验',3,4,'以下金融产品或服务，您投资经验在两年以上的有','银行存款等','债券、货币市场基金、债券型基金或其他固定收益类产品等','股票、混合型基金、偏股型基金、股票型基金等权益类投资品种等','期货、融资融券','复杂金融产品、其他产品或服务','',0,1,2,5,7),(12,'四、投资目标',4,1,'您计划的投资期限是多久？','1年以下','1至3年','3至5年','5年以上','','',1,2,3,4,0),(13,'四、投资目标',4,2,'您打算将自己的投资回报主要用于：','改善生活','个体生产经营或证券，期货投资以外的投资行为','履行抚养或赡养义务','偿付债务','','',6,5,4,3,0),(14,'四、投资目标',4,3,'您打算重点投资于哪些种类的投资品种？','债券、货币市场基金、债券基金等固定收益类投资品种','股票、混合型基金、股票型基金等权益类投资品种','期货、期权等金融衍生品','其他产品或者服务','','',1,3,4,6,0),(15,'五、风险偏好',5,1,'以下哪项描述最符合您的投资态度？','厌恶风险，不希望本金损失，希望获得稳定回报','保守投资，不希望本金损失，愿承担一定幅度的收益波动','寻求资金的较高收益和成长性，愿承担有限的本金损失','希望赚取高回报，愿意为此承担较大本金损失','','',0,2,4,6,0),(16,'五、风险偏好',5,2,'假设有两种投资：投资A预期获得10%的收益，可能承担的损失非常小；投资B预期获得30%的收益，但可能承担较大亏损。您会怎么支配您的投资','全部投资于收益较小且风险较小的A','同时投资于A和B，但大部分资金投资于收益较小且风险较小的A','同时投资于A和B，两种投资各一半','同时投资于A和B，但大部分资金投资于收益较大且风险较大的B','全部投资于收益较大且风险较大的B','',0,1,2,3,4),(17,'五、风险偏好',5,3,'您认为自己能承受的最大投资损失是多少？','10%以内','10%-30%','30%-50%','超过50%','','',0,2,4,6,0),(18,'六、其他信息',6,1,'您的年龄介于','超过60岁','51~60岁','18~30岁','31~40岁','41~50岁','',0,2,5,7,3),(19,'六、其他信息',6,2,'您的最高学历是','高中及以下','大学专科','大学本科','硕士及以上','','',1,2,3,4,0),(20,'六、其他信息',6,3,'您家庭的就业状况','未婚，无稳定收入工作','未婚，有稳定收入工作','您与配偶均没有稳定收入的工作或已退休','您与配偶其中一人有稳定收入工作','您与配偶均有稳定收入工作','',0,2,1,3,4);

